INSERT INTO `room_detail_categories` (`id`, `room_id`, `name`, `text`, `room_avilability_text`, `status`) VALUES
	(1, 1, 'Overview', '<h5 class="text-uppercase\r\n                        " style="font-family: Poppins, sans-serif; font-weight: bold; line-height: 25px; color: rgb(51, 51, 51); margin-top: 10px; margin-bottom: 10px; font-size: 18px;">DE FINIBUS BONORUM ET MALORUM", WRITTEN BY CICERO IN 45 BC</h5><p style="font-size: 14px; color: rgb(51, 51, 51); font-family: Poppins, sans-serif;">Located in the heart of Aspen with a unique blend of contemporary luxury and historic heritage, deluxe accommodations, superb amenities, genuine hospitality and dedicated service for an elevated experience in the Rocky Mountains.</p>', '<h5 class="text-uppercase\r\n                        " style="margin-top: 10px; margin-bottom: 10px; font-family: Poppins, sans-serif; font-weight: bold; line-height: 25px; color: rgb(51, 51, 51); font-size: 18px;"><img src="data:image/png;base64," style="width: 25%;" data-filename="Home Page.png"></h5><p style="margin-top: 10px; margin-bottom: 10px; font-family: Poppins, sans-serif; font-weight: bold; line-height: 25px; color: rgb(51, 51, 51); font-size: 18px;"><br></p><h5 class="text-uppercase\r\n                        " style="margin-top: 10px; margin-bottom: 10px; font-family: Poppins, sans-serif; font-weight: bold; line-height: 25px; color: rgb(51, 51, 51); font-size: 18px;">DE FINIBUS BONORUM ET MALORUM", WRITTEN BY CICERO IN 45 BC</h5><p style="font-size: 14px; color: rgb(51, 51, 51); font-family: Poppins, sans-serif;">Located in the heart of Aspen with a unique blend of contemporary luxury and historic heritage, deluxe accommodations, superb amenities, genuine hospitality and dedicated service for an elevated experience in the Rocky Mountains.</p>', 1),
	(2, 1, 'New Section', '<p><b>New section text</b></p>', '<h6><span style="font-weight: bolder; font-family: Lato; background-color: rgb(255, 255, 0);"><font color="#000000"><br></font></span></h6><table class="table table-bordered"><tbody><tr><td><b>Title 01</b></td><td><b>Title 02</b></td><td><span style="font-family: Lato;"><b>Title 03</b></span><b><br></b></td><td><span style="font-family: Lato;"><b>Title 04</b></span><br></td></tr><tr><td>Data 01</td><td><span style="font-family: Lato;">Data 02</span><br></td><td><span style="font-family: Lato;">Data 03</span><br></td><td><span style="font-family: Lato;">Data 03</span><br></td></tr></tbody></table><h6><span style="font-weight: bolder; font-family: Lato; background-color: rgb(255, 255, 0);"><font color="#000000"><br></font></span></h6>', 1),
	(3, 1, 'Another Section', '<p><span style="font-family: Poppins;"></span><span style="font-family: Poppins; background-color: rgb(255, 255, 0);"><font color="#000000">This is Another Section Description</font></span></p><p><span style="font-family: Poppins; background-color: rgb(255, 255, 0);"><font color="#000000"><br></font></span></p><p><span style="font-family: Poppins; background-color: rgb(255, 255, 0);"><font color="#000000"><br></font></span></p><table class="table table-bordered"><tbody><tr><td><b>Table Column 01</b></td><td><b>Table Column 02</b></td></tr><tr><td>Row 01</td><td>Row 01</td></tr></tbody></table><p><span style="font-family: Poppins; background-color: rgb(255, 255, 0);"><font color="#000000"><br></font></span><br></p>', '<p><span style="font-family: Poppins;"></span><span style="font-family: Poppins;"></span><span style="background-color: rgb(255, 255, 0); color: rgb(0, 0, 0); font-family: Poppins;">This is Another Section Description for Room Availability</span><br></p>', 1);
